import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">ðŸš— CarHop</div>
      <div className="navbar-links">
        <Link to="/home" className="navbar-link">Home</Link>
        <Link to="/profile/view" className="navbar-link">My Trips</Link>
        <div className="dropdown">
          <button className="dropdown-btn">Profile</button>
          <div className="dropdown-content">
            <Link to="/profile/view" className="dropdown-item">View Profile</Link>
            <Link to="/profile/update" className="dropdown-item">Update Profile</Link>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
